Binding.Expression:
LET $ownedModules :=

DB_LOOKUP(
  ARRAY("Owns Integrated Module - Procurement Planning", "Owns Integrated Module - Evaluations", "Owns Integrated Module - Contracts"),
  "Global Settings",
  "[LineNumber] FAST_EQUAL_TO 1"
);

LET $recordTypes :=
ARRAY(
  	IF(ARRAY_INDEX($ownedModules,1), "Procurement", NULL()),
  	IF(ARRAY_INDEX($ownedModules,2), "Evaluation", NULL()),
  	IF(ARRAY_INDEX($ownedModules,3), "Contract", NULL()),
);

RETURN ARRAY_WHERE($recordTypes, $(i,item) $item <> NULL())

FieldEntry.Formula:
LET $fields := IF( [EFormType to Reassign] = "Procurement", ARRAY("RecordID","Procurement Number", "Procurement Title", "Procurement Officer Display Name", "Procurement Manager Display Name"), [EFormType to Reassign] = "Evaluation", ARRAY("RecordID", "Title", "Individual Display Name in Role"), [EFormType to Reassign] = "Contract", ARRAY("RecordID","Contract Number", "Contract Title", "Contract Manager Display Name", "Contract Owner Display Name","Contract Sponsor Display Name") );
LET $headings := ARRAY_SELECT( $fields, $(i,item) HASH("heading", $item, "width", (35 * 20 - 1)/ARRAY_LENGTH($fields)) );
LET $rows := DB_LOOKUPALL( $fields, [EFormType to Reassign], "[Username in Role] FAST_EQUAL_TO " & DB_ENCODECONSTANT([Previous Assignee]) );
RETURN HASH( "columns", $headings, "rows", $rows )

FormulaCriterion.Formula:
//This is a failsafe in case the user somehow manages to get to trigger this without having filled in all required fields
AND(
  	NOT(ISBLANK([EFormType to Reassign])),
  	NOT(ISBLANK([Previous Assignee])),
  	NOT(ISBLANK([New Assignee]))
)

Binding.Expression:
//This is a failsafe in case the user somehow manages to get to this button without filling out a field
OR(
  	ISBLANK([EFormType to Reassign]),
  	ISBLANK([Previous Assignee]),
  	ISBLANK([New Assignee])
)
